We introduce active querying:
\begin{itemize}
\item \textbf{Goal:} find a subset of data with high variance under the posterior
\item Given samples $\mathcal{T}$ and subset $S$, define tree-distance variance (TDV) as
\begin{align*}
 \mathrm{TDV}(\mathcal{T}, S) = \max_{u, v \in S}\mathrm{Var}_{T \in \mathcal{T}}[\texttt{treedist}_{T|_S}(u, v)]
\end{align*}
where {\tt treedist} is the number of edges needed to get from node $u$ to node $v$.
\item Instantiate $L$ subsets uniformly
at random and pick the one with the highest TDV.
\end{itemize}
